import config from "../config";
import { useNavigate } from "react-router-dom";

const ClickThis = () => {
  const navigate = useNavigate();

  const handleClick = async () => {
    try {
      const response = await fetch(`http://${config.SERVER_URL}/request/up`, {
        credentials: "include",
      });

      if (!response.ok) {
        if (response.status === 404) navigate("/error/404");
        else if (response.status === 500) navigate("/error/500");
        else if (response.status === 503) navigate("/error/503");
        throw new Error("Network response was not ok");
      }

      console.log("Request sent successfully");
    } catch (error) {
      console.error("Error:", error);
    }
  };

  return (
    <div>
      <button onClick={handleClick}>Send Request</button>
    </div>
  );
};

export default ClickThis;
